Storyline:

     A New York tourist (Tony Curtis) falls asleep on a Southern California beach on his first night in the West and wakes up to The New Phantasmagoria--catamarans, surfers (including a dog), bodybuilders, acrobats, motorcycle chicken races, a nut fishing in the shallows . . . and  a skydiver named Malibu (Sharon Tate ).



